import { useParams } from "react-router-dom";
export default function Detail() {
    const { id } = useParams();
    return (
        <div style={{
            position: 'relative',
        }}>
            <h1>SOY DETAIL ID: {id}</h1>
            <div style={{
                position: 'absolute',
                width:'60%',
                height: '60%',
            }}>

            </div>

        </div>
    );
};
